const App = () => {
  const Course = ({courses}) => {
    const Header = ({course}) => {
    return (
    <div>
      <h1> {course}</h1>
    </div>
    )
  }
    const Content = ({parts}) => {
      return (
        <div>
          {parts.map}
        </div>
      )
    }
  <div>
    {courses.map(course =>
      <div key={course.id}>
        <Header course={course.name} />
        <Content parts={course.parts}/>
        <Total parts={course.parts}/>
      </div>
    )}
  </div>
  }
}

export default App
